const example_users = [
  { username: "kobepane14", country: "USA" },
  { username: "JohnDeere182", country: "Canada" },
  { username: "ElPresidente", country: "Mexico" },
];

const data = [
  { name: "USA", value: 4 },
  { name: "Canada", value: 3 },
  { name: "Mexico", value: 3 },
  { name: "Greenland", value: 2 },
];

const example_messages = [
  { message: "Hello", user: "Alex123" },
  { message: "Hey, how's it going", user: "Bob456" },
  { message: "Not too bad, wbu?", user: "Alex123" },
  { message: "Just chillin", user: "Bob456" },
